import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
    container: {
      flex: 1,
      padding: 20,
      backgroundColor: 'white'
    },
    title: {
      color: 'white',
      fontSize: 20,
      fontWeight: 'bold',
    },
    image: {
      height: 150,
      width: 220,
      resizeMode: 'cover',
      borderRadius: 5,
    },
  });

  export default styles;
